fn main() {
  let kernel = vec![
    vec![1,1,1],
    vec![1,0,1],
    vec![1,1,1],
  ];

  let mut input = get_test_input();
  for _ in 0..4 {
    input = apply_kernel(&input, &kernel);
  }
  let count: usize = input.iter().map(|r| r.iter().sum::<usize>()).sum();
  assert_eq!(count, 4);

  let mut input = get_test_input();
  turn_on_corners(&mut input);
  for _ in 0..5 {
    input = apply_kernel(&input, &kernel);
    turn_on_corners(&mut input);
  }
  let count: usize = input.iter().map(|r| r.iter().sum::<usize>()).sum();
  assert_eq!(count, 17);

  let mut input = get_input();
  for _ in 0..100 {
    input = apply_kernel(&input, &kernel);
  }
  let count: usize = input.iter().map(|r| r.iter().sum::<usize>()).sum();
  println!("{}", count);

  let mut input = get_input();
  turn_on_corners(&mut input);
  for _ in 0..100 {
    input = apply_kernel(&input, &kernel);
    turn_on_corners(&mut input);
  }
  let count: usize = input.iter().map(|r| r.iter().sum::<usize>()).sum();
  println!("{}", count);
}

fn apply_kernel(img: &Vec<Vec<usize>>, kernel: &Vec<Vec<usize>>) -> Vec<Vec<usize>> {
  let y = img.len();
  let x = img[0].len();

  let yy = kernel.len();
  let xx = kernel[0].len();

  assert!(yy % 2 == 1);
  assert!(xx % 2 == 1);

  let mut result = Vec::new();

  for i in 0..y {
    let mut row = Vec::new();
    for j in 0..x {
      let mut sum = 0;
      for ii in 0..yy {
        for jj in 0..xx {
          if (i == 0 && ii == 0) || (j == 0 && jj == 0) {
            continue;
          }
          let iii = i + ii - yy/2;
          let jjj = j + jj - xx/2;

          if iii >= y || jjj >= x || kernel[ii][jj] == 0 {
            continue;
          }

          sum += kernel[ii][jj] * img[iii][jjj];
        }
      }
      let el = img[i][j];
      let res = if el == 0 && sum == 3 { 1 }
        else if el == 0 { 0 }
        else if el == 1 && sum == 2 { 1 }
        else if el == 1 && sum == 3 { 1 }
        else { 0 };
      row.push(res);
    }
    result.push(row);
  }

  result
}

fn turn_on_corners(img: &mut Vec<Vec<usize>>) {
  let y = img.len();
  let x = img[0].len();

  img[0][0] = 1;
  img[0][x - 1] = 1;
  img[y - 1][0] = 1;
  img[y - 1][x - 1] = 1;
}

fn get_test_input() -> Vec<Vec<usize>> {
  vec![
    vec![0,1,0,1,0,1,],
    vec![0,0,0,1,1,0,],
    vec![1,0,0,0,0,1,],
    vec![0,0,1,0,0,0,],
    vec![1,0,1,0,0,1,],
    vec![1,1,1,1,0,0,],
  ]
}

